export const InsuranceModal = ({
  setEmailSent
}: {
  setEmailSent: (s: boolean) => void;
}) => {
  const [visible, setVisible] = useState<boolean>(false);
  return (
    <>
      <Button
        type="primary"
        size="large"
        onClick={() => {
          setVisible(true);
        }}
      >
        Send documents
      </Button>
      <Modal
        title="Send Document to Insurer"
        visible={visible}
        onOk={() => {
          setVisible(false);
          message.info("Sending...");
          setTimeout(() => {
            message.info("Documents sent!");
            setEmailSent(true);
          }, 1000);
        }}
        onCancel={() => setVisible(false)}
        okText="Send"
      >
        <Form layout="vertical">
          <Form.Item label="Select document">
            <Select defaultValue="form">
              <Select.Option value="form">
                Social Determinants of Health Form
              </Select.Option>
            </Select>
          </Form.Item>
          <Form.Item label="Contact method">
            <Select defaultValue="email">
              <Select.Option value="email">Email</Select.Option>
            </Select>
          </Form.Item>
        </Form>
      </Modal>
    </>
  );
};

export const InsuranceCoverage = () => {
  const [emailSent, setEmailSent] = useState<boolean>(false);
  return (
    <>
      <motion.div
        style={{ marginTop: "20px", opacity: "0" }}
        animate={{ marginTop: 0, opacity: 1 }}
        transition={{ duration: 0.5 }}
      >
        <CardInner>
          <Coverage>
            <CoverageInfo />
            <InsuranceModal setEmailSent={setEmailSent} />
          </Coverage>
        </CardInner>
      </motion.div>
      <motion.div
        style={{ marginTop: "20px", opacity: "0" }}
        animate={{ marginTop: 0, opacity: 1 }}
        transition={{ duration: 0.5, delay: 0.5 }}
      >
        <CardInner>
          <CommunicationHistory emailSent={emailSent} />
        </CardInner>
      </motion.div>
    </>
  );
};
